import styled from 'styled-components';

const LogoutContainer = styled.button`
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 0.5rem;
    background-color: rgb(247,148,29);
    border: none;
    border-radius: 5px;
    cursor: pointer;
    svg {
        font-size: 1.3rem;
        color: #ebe7ff;
    }
`;

export default LogoutContainer;
